import {
  ADD_TO_CART,
  REMOVE_TO_CART,
  ADD_TO_WISHLIST,
  REMOVE_TO_WISHLIST,
  LOGOUT,
  LOGIN,
  ADD_TO_ORDER,

} from "../constant";
export const AddToCart = (data) => {
  return {
    type: ADD_TO_CART,
    data: data,
  };
};

export const RemoveToCart = (data) => {
  return {
    type: REMOVE_TO_CART,
    data: data,
  };
};

export const WishListToCart = (data) => {
  return {
    type: ADD_TO_WISHLIST,
    data: data,
  };
};
export const RemoveWishList = (data) => {
  return {
    type: REMOVE_TO_WISHLIST,
    data: data,
  };
};

export const UserLogin = (data) => {
  return {
    type: LOGIN,
    data: data,
  };
};

export const UserLogOut = (data) => {
  return {
    type: LOGOUT,
    data: data,
  }
}


export const OrderData = (data) => {
  return {
    type: ADD_TO_ORDER,
    data: data,
  }
}
